import React from 'react'
import {Link} from "react-router-dom";


export default function Rooms({id, rooms}) {
    console.log({id})

    let priceSpan = {
        float: "left",
        top:"200px",
        margin: 0,
        padding: -20,
        borderRadius: "0 0 10 0",
        backgroundColor: "black",
        color: "white"
    }
    return (
        <Link to={`/rooms/${rooms.slug}`} key={id} style={{textDecoration:"none"}}>
        <section key={id} style={{backgroundImage:`url(${rooms.images[0]})`, backgroundSize:"cover"}} className="room">
            <span  style={priceSpan}><h6>{rooms.price}</h6></span>
            <h6>{rooms.name}</h6>

        </section>
        </Link>
    )
}
